const updateRegistration = (state, action) => {

    const initialState = {
        loginField : "",
        passwordField : "",
        repeatPasswordField : ""
    };

    if(state === undefined) {
      return initialState;
    }

    switch(action.type) {
        case '':
        default:
            return state.registrationBlock
    }

};

export default updateRegistration;
